import React from 'react'
import Typewriter from 'typewriter-effect'

import Avatar from '@mui/material/Avatar'
import Box from '@mui/material/Box'
import List from '@mui/material/List'
import ListItem from '@mui/material/ListItem'
import ListItemText from '@mui/material/ListItemText'
import Divider from '@mui/material/Divider'

import ListItemButton from '@mui/material/ListItemButton'
import ListItemIcon from '@mui/material/ListItemIcon'

import GitHubIcon from '@mui/icons-material/GitHub'
import LinkedInIcon from '@mui/icons-material/LinkedIn'
import FacebookIcon from '@mui/icons-material/Facebook'
import OnDeviceTrainingIcon from '@mui/icons-material/OnDeviceTraining'
const style = {
  width: '100%',
  maxWidth: 360,
  bgcolor: 'background.paper',
}

const Aboutme = () => {
  // const DownloadCV = async () => {
  //   //console.log(file)
  //   fetch(cvpdf)
  //     .then((response) => response.blob())
  //     .then((blob) => {
  //       // Trigger the download using FileSaver.js
  //       saveAs(blob, 'DS-FullStackDev.pdf')
  //     })
  //     .catch((error) => {
  //       console.error('Error downloading the file:', error)
  //     })
  // }

  return (
    <>
      <Box sx={{ display: 'flex', justifyContent: 'center' }}>
        <Avatar sx={{ bgcolor: 'info.main' }}>DS</Avatar>
      </Box>
      <List sx={style} component="div" aria-label="mailbox folders">
        <ListItem>
          <ListItemText
            sx={{
              color: '#5c6bc0',
              display: 'flex',
              justifyContent: 'center',
            }}
            primary="Djebbi Safwen"
          />
        </ListItem>
        <Divider />
        <ListItem divider>
          <ListItemText
            sx={{
              color: '#5c6bc0',
              display: 'flex',
              justifyContent: 'center',
            }}
            primary={
              <Typewriter
                options={{
                  strings: [
                    'FullStack Developper',
                    'Web Developper',
                    'Software Engineer',
                  ],
                  autoStart: true,
                  loop: true,
                }}
              />
            }
          />
        </ListItem>
        <Divider />
        <ListItem sx={{ display: 'flex', justifyContent: 'center' }}>
          <GitHubIcon
            color="#212121"
            fontSize="large"
            sx={{ marginRight: '5px' }}
          />
          <Divider orientation="vertical" flexItem></Divider>
          <LinkedInIcon
            color="info"
            fontSize="large"
            sx={{ marginRight: '5px', marginLeft: '5px' }}
          />
          <Divider orientation="vertical" flexItem></Divider>
          <FacebookIcon
            color="primary"
            fontSize="large"
            sx={{ marginLeft: '5px' }}
          />
        </ListItem>
      </List>
      <List sx={{ border: 1, borderColor: 'secondary.main', borderRadius: 1 }}>
        <ListItem disablePadding>
          <ListItemButton>
            <ListItemIcon>
              <InboxIcon />
            </ListItemIcon>
            <ListItemText primary="+216 26 706 437" />
          </ListItemButton>
        </ListItem>
      </List>
    </>
  )
}

export default Aboutme
